After the sold out class of early March, the @dirtfishrally / @ozrallypro Codriver Development Program will return one more time this year, with the dates of May 27 and 28 now available. 

This will be our 8th Program in partnership with DirtFish at their world class facilities in Seattle, WA. This is the only codriver program in North America that includes a portion of the training in rally cars, on a rally stage at the end of the training. 
The program is designed for the inexperienced looking to get introduced to our sport, as well as codrivers that have competed already and are looking to refine their skills and improve their knowledge, learning from our instructors, which have a combined experience of over 700 rallies around the world (and 60 WRC events). 
Limited to 12 students. 

Link for more info and to book in my bio. 
