ONBOARD ACTION - Cossie V2 - @liakblock 

This week was truly a privilege. To have the opportunity to co-drive for @liakblock in the famous Cossie V2, that her dad @kblock43 & my husband @alexgelsomino took on the Cossie World Tour, was an incredible experience!! 

@liakblock and I unfortunately only got to complete 3 stages, before the Cossie broke at the stage 4 control, but our smiles told the story. This was a special time for us both. 

Enjoy this onboard from our 2nd ever stage in the Cossie, at the @lakesuperiorperformancerally. We finished 3rd overall @ara_rally in this stage. 

