It’s been the hardest year for us and the @blockhouseracing family, but we continued to rally and pay tribute to the legend @kblock43, just like he had planned for 2023. 

What we achieved with @liakblock & @mrslucyjonesblock and the @blockhouseracing crew was impressive. Lia & Lucy’s times and improvements from 2022, was something we are all proud to have played a part in! 

To see the joy rally brought to the team, was why we all had to continue ❤️

@kblock43 🙌 We miss you dearly everyday, but you would be so proud of what @blockhouseracing achieved this season. 

@alexgelsomino, I love you and are always so happy to see you continuing for Ken 💯

Couldn’t be more proud of @liakblock!! Her talent at only 17 years old, has been noticed at the highest level of Motorsport, with @williamsracing signing her to the Williams Racing Driver Academy and Lia will enter the 2024 F1 Academy Championship. 

So happy we got to achieve amazing things together in 2023. Now go chase those dreams 💯

